import React, { useState } from "react";

import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import Typography from "@material-ui/core/Typography";
import { SYMBOLS, SHORT_DATE_FORMAT } from "../../Constants/Constants";
import useStyles from "../SearchDetails/styles";
import Grid from "@material-ui/core/Grid";
import format from "date-fns/format";
import { DatePicker } from "@material-ui/pickers";
import Box from "@material-ui/core/Box";
const History = ({ histroyDay, date, aDate }) => {
  const classes = useStyles();
  const [selectedDate, handleDateChange] = useState(new Date());

  return (
    <>
      <Typography variant="h2" className={classes.title}>
        View History
      </Typography>
      <Grid item xs={12}>
        {/* <KeyboardDatePicker
          label="Select Date"
          clearable
          maxDate={new Date()}
          format="yyyy/MM/dd"
          value={date}
          onChange={(date) => handleDateChange(date)}
        /> */}
        <DatePicker
          views={["year", "month"]}
          label="Year and Month"
          helperText="With min and max"
          minDate={new Date("2018-03-01")}
          maxDate={new Date("2018-06-01")}
          value={selectedDate}
          onChange={handleDateChange}
        />
        {format(new Date(histroyDay.date), SHORT_DATE_FORMAT)}
      </Grid>
      <Grid item md={1} xs={6}>
        <Box>
          <img
            className={classes.media}
            src={histroyDay.day.condition.icon}
            alt="weather"
          ></img>
        </Box>
      </Grid>
      <Grid item md={2} xs={6}>
        <Typography className={classes.degrees}>
          {histroyDay.day.temp_c} {SYMBOLS.DEGREES}
        </Typography>
        <Typography className={classes.degrees}>
          {histroyDay.day.condition.text}
        </Typography>
      </Grid>

      <Card>
        <CardContent>
          <Box mb={2} ml={4} mr={-4}>
            <Grid container spacing={2} justify="space-between">
              <Grid item xs={4}>
                <Typography className={classes.subTitle}>
                  {histroyDay.day.mintemp_c} {SYMBOLS.DEGREES}
                </Typography>
                <Typography className={classes.subText}>Low</Typography>
              </Grid>
              <Grid item xs={4}>
                <Typography className={classes.subTitle}>
                  {histroyDay.day.maxwind_mph} mph
                </Typography>
                <Typography className={classes.subText}>Wind</Typography>
              </Grid>
              <Grid item xs={4}>
                <Typography className={classes.subTitle}>
                  {histroyDay.astro.sunrise}
                </Typography>
                <Typography className={classes.subText}>Sunrise</Typography>
              </Grid>
            </Grid>
          </Box>

          <Box ml={4} mr={-4}>
            <Grid container spacing={2} justify="space-between">
              <Grid item xs={4}>
                <Typography className={classes.subTitle}>
                  {histroyDay.day.maxtemp_c} {SYMBOLS.DEGREES}
                </Typography>
                <Typography className={classes.subText}>High</Typography>
              </Grid>
              <Grid item xs={4}>
                <Typography className={classes.subTitle}>
                  {histroyDay.day.daily_will_it_rain === 1 ? "Yes" : "No"}
                </Typography>
                <Typography className={classes.subText}>Rain</Typography>
              </Grid>
              <Grid item xs={4}>
                <Typography className={classes.subTitle}>
                  {histroyDay.astro.sunset}
                </Typography>
                <Typography className={classes.subText}>Sunset</Typography>
              </Grid>
            </Grid>
          </Box>
        </CardContent>
      </Card>
    </>
  );
};

export default History;
